import React, { useState } from 'react';

const TodoList = () =>{

    let [listName, UpdateListName ] = useState();

    const inputEvent = (event) =>{
            UpdateListName(event.target.value)
    }
    return (

      
        <>
        <div className='main_div'>
            <div className='center_div'>
                <br />
                <h1>ToDo List</h1>
                <br />
                <input  type="text" placeholder="Add a Items" onChange={InputEvent} value={listName} />
                <button>+</button>

                <ol>
                    <li>{listName}</li>
                </ol>
            </div>
        </div>
        </>
    )
}


export default TodoList;
